    articles: {
      list: {},
    },
    users: []
}

// const composedEnhancer = composeWithDevTools(applyMiddleware(ThunkMiddleware))
const composedEnhancer = composeWithDevTools()



 const setUpStore = (initialState = {}) => {
  return createStore(
    combinedStoreReducers,
    { ...defaultState, ...initialState },
    composedEnhancer
  )
}

export { setUpStore }

